import React from "react";
import SignIn from "../SignIn/SignIn";
import SignUp from "../SignUp/SignUp";

const SignInAndSignUp=()=>(
    <div className="sign">
        <SignIn />
        <SignUp/>
    </div>
)
export default SignInAndSignUp;
